import React, { Component } from 'react';

class Search extends Component {
  render() {
    return (
      <div>
        <form className='form'>
          <input type='text' name='text' placeholder='Search Users...' />
          <input
            type='submit'
            name='Search'
            className='btn btn-dark btn-block'
          />
        </form>
      </div>
    );
  }
}

export default Search;
